import styled, { keyframes } from 'styled-components';

import { Button } from './Button.styles';

function Backdrop({ ...props }) {
	const expandingAnimation = keyframes`
	0% {height: 0vh; width: 0vw}
	20% {height: 20vh; width: 20vw}
	40% {height: 40vh; width: 40vw}
	60% {height: 60vh; width: 60vw}
	80% {height: 80vh; width: 80vw}
	100% {height: 100vh; width: 100vw}
	`;

	const Backdrop = styled.div`
		background-color: white;
		height: 100vh;
		width: 100vw;
		z-index: 1000;
		position: fixed;
		top: 50%;
		left: 50%;
		transform: translate(-50%, -50%);
		animation-name: ${expandingAnimation};
		animation-duration: 2s;
	`;

	const Header = styled.div``;

	const Button = styled.button``;

	return (
		<Backdrop>
			<Header>
				<Button>&#10006;</Button>
			</Header>
			{props.children}
		</Backdrop>
	);
}

export default Backdrop;
